import React from "react";

import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

import { Navigation, Pagination, Mousewheel, Keyboard } from "swiper";

import { Image1 } from "./Image/Al.jpg";
import { Image2 } from "./Image/Certificate_page-0001.jpg";
import { Image3 } from "./Image/LIBREOFFICE_SUITE CALC_pdf_page-0001.jpg";
import { Image4 } from "./Image/data analysis_page-0001.jpg";
import { Image5 } from "./Image/java_training_page-0001.jpg";
import { Image6 } from "./Image/machine-learning-30-day-s_page-0001.jpg";
import { Image7 } from "./Image/python-10-days_page-0001.jpg";
import { Image8 } from "./Image/sql_page-0001.jpg";

const Certificate =()=>{
    return (
        <div className="Slider" id="H1-Certificate">
          <h1 className="H1-Certificate">Certificate</h1>
          <div className="slider-center">
          <Swiper
        cssMode={true}
        navigation={true}
        pagination={true}
        mousewheel={true}
        keyboard={true}
        modules={[Navigation, Pagination, Mousewheel, Keyboard]}
        className="mySwiper"
      >
        <SwiperSlide>Slide 1</SwiperSlide>
        <SwiperSlide>Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>
          </div>
        </div>
    )
}

export default Certificate
